export default App;

import React, { useState } from 'react';

const CrearTareas = () => {
  const [nombreTarea, setNombreTarea] = useState('');

  const handleInputChange = (event) => {
    setNombreTarea(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Aquí puedes realizar cualquier acción con el nombre de la tarea,
    // como enviarlo a un servidor o almacenarlo en otro componente.
    console.log('Nombre de la tarea:', nombreTarea);
  };

  return (
    <div>
      <h1>Crear Nueva Tarea</h1>
      <form onSubmit={handleSubmit}>
        <label>
          Nombre de la tarea:
          <input type="text" value={nombreTarea} onChange={handleInputChange} />
        </label>
        <button type="submit">Crear Tarea</button>
      </form>
    </div>
  );
};
